import Winner from "./Winner";

const winners = [{ address: "0xCf076007E6C36cFB1eb2cD36AD66405feC7d0B31", fee: "0.1", entrance_date: "20-09-2021", won: "0.945", date: "20-09-2021" },
{ address: "0xCf076007E6C36cFB1eb2cD36AD66405feC7d0B31", fee: "0.1", entrance_date: "20-09-2021", won: "0.945", date: "20-09-2021" },
{ address: "0xCf076007E6C36cFB1eb2cD36AD66405feC7d0B31", fee: "0.1", entrance_date: "20-09-2021", won: "0.945", date: "20-09-2021" },
{ address: "0xCf076007E6C36cFB1eb2cD36AD66405feC7d0B31", fee: "0.1", entrance_date: "20-09-2021", won: "0.945", date: "20-09-2021" }]
function RecentWinners(props) {
    return (
        <div className={"recent-winners"}>
            <h1 className={"recent-winners-heading"}>Recent Winners</h1>
            {winners.map((winner) => {
                return (
                    <Winner winner={winner} />
                );

            })}

        </div>
    )
}

export default RecentWinners;
